import React from 'react';
import gapi from 'gapi-client';
import './App.css';

function App() {

  fetch("https://www.reddit.com/api/v1/authorize?client_id=BmIWdmE0hYrM7Q&response_type=token&client_secret=4JqjPfffuZtkeJLIPnc1jYtAOxe7_w&redirect_uri=http://localhost:3000&duration=permanent&scope=read")
  .then((response) => {
    console.log(response.result);
  });

  return (
    <div className="App">
    </div>
  );
}

export default App;
